sys_variable_value.value:
(function execute(inputs, outputs) {
    var eventNumber = inputs.eventNumber;
    var eventUtils = new EventUtils(eventNumber);
    
    var eventRecord = eventUtils.getEventDetails();
    outputs.eventdetails = eventRecord ? eventRecord.getDisplayValue() : null;

    outputs.isVIP = eventUtils.isVIP();
    outputs.remainingbudget = eventUtils.getRemainingBudget();

    var tasks = eventUtils.getEventTasks();
    outputs.eventtasks = JSON.stringify(tasks);

    var attendees = eventUtils.getEventAttendees();
    outputs.eventattendees = JSON.stringify(attendees);

    var vendors = eventUtils.getEventVendors();
    outputs.eventvendors = JSON.stringify(vendors);

    var budgets = eventUtils.getEventBudgetDetails();
    outputs.eventbudgetdetails = JSON.stringify(budgets);

    var feedback = eventUtils.getEventFeedback();
    outputs.eventfeedback = JSON.stringify(feedback);
})(inputs, outputs);

